// src/Profile.js
import React from "react";
import { auth } from "./firebase";
import { signOut } from "firebase/auth";
import Posts from "./Posts";

function Profile({ user, onLogout }) {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <h1 className="text-4xl font-bold mb-4">Welcome, {user.email}!</h1>
      <p className="mb-6">You are now logged into HappyHour.</p>

      <button
        onClick={onLogout}
        className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600 mb-6"
      >
        Logout
      </button>

      {/* Add Posts component here */}
      <div className="w-full max-w-md">
        <Posts user={user} />
      </div>
    </div>
  );
}

export default Profile;
